    n, m = list(map(int, stdin.split()))
    matrix = []
    for i in range(n):
        matrix.append(list(map(int, stdin.split())))

    def row_inversion(row: List[int]) -> None:
        for i in range(len(row)):
            if row[i] == 0:
                continue
            for j in range(i + 1, len(row)):
                if row[j] == 0:
                    continue
                if row[i] > row[j]:
                    row[i], row[j] = row[j], row[i]

    def column_inversion(column: List[int]) -> None:
        for i in range(len(column)):
            if column[i] == 0:
                continue
            for j in range(i + 1, len(column)):
                if column[j] == 0:
                    continue
                if column[i] > column[j]:
                    column[i], column[j] = column[j], column[i]

    for row in matrix:
        row_inversion(row)
        column_inversion(row)
    return "YES" if matrix == sorted(matrix, key=lambda row: row) else "NO"

