    X = int(X)
    cities = list(map(int, stdin.split()))
    counter = 0
    visited = []
    for i in range(N):
        if X in cities:
            visited.append(X)
            cities.remove(X)
        elif X + N - i in cities:
            visited.append(X + N - i)
            cities.remove(X + N - i)
        elif X - i in cities:
            visited.append(X - i)
            cities.remove(X - i)

        if len(visited) == N:
            return str(len(visited))

        if i == N - 1:
            counter = max(counter, len(visited))
    return str(counter)

